import React from 'react';
import { connect } from 'react-redux';
import * as actions from '../../Redux/Actions/actions';

class Booking extends React.PureComponent {
  render() {
    var email;

    var getClientByEmail = () => {
      return () => {
        this.props.getByEmail(email);
      };
    };

    getClientByEmail = getClientByEmail.bind(this);

    var clientCheck = (
      <>
        <p>Email</p>
        <input
          placeholder="Enter your email"
          type="email"
          onChange={(e) => {
            email = e.target.value;
          }}
        />
        <button className="modalButton" onClick={getClientByEmail(email)}>
          Next
        </button>
      </>
    );

    var createOrder;
    if (this.props.singleResponseData !== '') {
      createOrder = <></>;
    }

    return <div>{clientCheck}</div>;
  }
}

function mapStateToProps(state) {
  return {
    singleResponseData: state.singleResponseData,
  };
}

function mapDispatchToProps(dispatch) {
  return {
    getByEmail: (email) => dispatch(actions.FetchClientByEmail(email)),
  };
}

export default connect(mapStateToProps, mapDispatchToProps)(Booking);
